?definitions:
oppervlaktewater waar, naar verwachting van de bevoegde autoriteit, een groot aantal mensen zal zwemmen, en waar zwemmen niet permanent verboden is of waarvoor geen permanent negatief zwemadvies bestaat (hierna „zwemwater” te noemen). Zij is niet van toepassing op:
a) zwembaden en gezondheidsbaden;
b) ingesloten wateren die behandeld worden, of gebruikt worden voor therapeutische doeleinden;
c) kunstmatig gecreëerde, van het oppervlaktewater en het grondwater gescheiden ingesloten wateren. (bron: 2006/7/EG)

1. een samenstel, voorzien van of bestemd om te worden voorzien van een aandrijfsysteem — maar niet op basis van rechtstreeks gebruikte menselijke of dierlijke spierkracht —, van onderling verbonden onderdelen of componenten waarvan er ten minste één kan bewegen, en die samengevoegd worden voor een bepaalde toepassing;
2. een samenstel als bedoeld onder het eerste streepje waaraan slechts de componenten voor de montage op de plaats van gebruik of voor de aansluiting op kracht of aandrijfbronnen ontbreken;
3. een samenstel als bedoeld onder de eerste twee streepjes dat gereed is voor montage en dat alleen in deze staat kan functioneren na montage op een vervoermiddel of montage in een gebouw of bouwwerk;
4. samenstellen van machines als bedoeld onder het eerste, tweede en derde streepje, en/of niet voltooide machines als bedoeld onder g) die, teneinde tot hetzelfde resultaat te komen, zodanig zijn opgesteld en worden bestuurd dat zij als één geheel functioneren;
5. een samenstel van onderling verbonden onderdelen of componenten waarvan er ten minste één kan bewegen, en die in hun samenhang bestemd zijn voor het heffen van lasten en die uitsluitend rechtstreeks aangedreven worden door menselijke spierkracht. (bron: 2006/42/EG)
